<item>
<title>2007-09-13 17:00:22</title>
<link>http://78.46.73.113/wiki/wakka.php?wakka=AmbsCardsManual/CardFormsLotsCards/CardsCardActions/show&amp;time=2007-09-13+17%3A00%3A22</link>
<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=AmbsCardsManual/CardFormsLotsCards/CardsCardActions&amp;amp;v=rxo" class="">/Ambs&amp;nbsp;Cards&amp;nbsp;Manual&amp;nbsp;/&amp;nbsp;Card&amp;nbsp;Forms&amp;nbsp;Lots&amp;nbsp;Cards&amp;nbsp;/&amp;nbsp;Cards&amp;nbsp;Card&amp;nbsp;Actions&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=AmbsCardsManual/CardFormsLotsCards/CardsCardActions&amp;amp;time=2007-09-13+17%3A00%3A22">2007-09-13 17:00:22&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=AmbsCardsManual/CardFormsLotsCards/CardsCardActions&amp;amp;time=2007-09-17+13%3A56%3A33">2007-09-17 13:56:33&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">Для&amp;nbsp;того что&amp;nbsp;бы&amp;nbsp;сменить пин-ключ, абоненту необходимо сделать следующее:&lt;br />
1.	В&amp;nbsp;поле «Card number» ввести название карточки – vt101;&lt;br />
2.	В&amp;nbsp;поле «PIN code» ввести пин-код и&amp;nbsp;пин-ключ карточки &amp;ndash; 311821 и&amp;nbsp;144807;&lt;br />
3.	Нажать кнопку «Find» для&amp;nbsp;поиска карточки по&amp;nbsp;введенным параметрам;&lt;br />
4.	В&amp;nbsp;поле «change pin-key» сменить пин-ключ (сообщение «must be&amp;nbsp;“_” numbers» указывает из&amp;nbsp;какого количества цифр должен состоять пин-ключ);&lt;br />
5.	Нажать кнопку «Change pin&amp;nbsp;key» для&amp;nbsp;подтверждения смены пин-ключа.&lt;/div>&lt;/div>
</description>
</item>
